import React, {Component} from "react";

class ShortStoryDetail extends Component {
    render() {
        return (
            <React.Fragment>
                <h3>Cinderella</h3>
                <div>
                    <img src="images/ShortStory/cinderella.jpg" alt="Cinderella"/>
                </div>
            </React.Fragment>
        );
    }
}

export default ShortStoryDetail;
